INSERT INTO `v1_823a72cef4b6e5af278e68b9fa83e495cc87a72bb046e99b48eff7ce29f651cb` VALUES (2002, 0.0, 126401, "クローチェ", 1, "2023/06/30 12:00:00", "2023/09/22 14:59:59", 2, 10001, 1, "いらっしゃいませっ♪\nキャラバンコインを使って\n買い物ができますよっ！", -470.0, 1.47, 1);
