INSERT INTO `v1_823a72cef4b6e5af278e68b9fa83e495cc87a72bb046e99b48eff7ce29f651cb` VALUES (2002, 0.0, 126501, "ライラエル", 2, "2023/06/30 12:00:00", "2023/09/22 14:59:59", 2, 10003, 1, "ショップへようこそ\nキャラバンコインはこちら\nで買い物に使えますよ", -470.0, 0.0, 1);
INSERT INTO `v1_823a72cef4b6e5af278e68b9fa83e495cc87a72bb046e99b48eff7ce29f651cb` VALUES (2002, 0.0, 126501, "ライラエル", 1, "2023/06/30 12:00:00", "2023/09/22 14:59:59", 1, 10004, 1, "こちらのショップで\n買い物をして、素敵な\n旅を楽しんでくださいね", -470.0, 0.0, 2);
INSERT INTO `v1_823a72cef4b6e5af278e68b9fa83e495cc87a72bb046e99b48eff7ce29f651cb` VALUES (2002, 0.0, 127702, "リンド", 2, "2023/09/15 15:00:00", "2023/12/22 14:59:59", 2, 10005, 2, "いらっしゃいませ\nキャラバンコインを使って\nお買い物ができますよ", -470.0, 0.0, 1);
INSERT INTO `v1_823a72cef4b6e5af278e68b9fa83e495cc87a72bb046e99b48eff7ce29f651cb` VALUES (2002, 0.0, 127702, "リンド", 2, "2023/09/15 15:00:00", "2023/12/22 14:59:59", 2, 10006, 2, "ショップの掃除は完璧です\n姫さま直営のお店として\n当然のことですから", -470.0, 0.0, 2);
INSERT INTO `v1_823a72cef4b6e5af278e68b9fa83e495cc87a72bb046e99b48eff7ce29f651cb` VALUES (2002, 0.0, 127802, "ヴルム", 1, "2023/09/15 15:00:00", "2023/12/22 14:59:59", 1, 10007, 2, "ショップへようこそ\nキャラバンコインと品物を\n交換できるんで、よければ", -470.0, 0.0, 1);
INSERT INTO `v1_823a72cef4b6e5af278e68b9fa83e495cc87a72bb046e99b48eff7ce29f651cb` VALUES (2002, 0.0, 127802, "ヴルム", 2, "2023/09/15 15:00:00", "2023/12/22 14:59:59", 1, 10008, 2, "なんで店番なんか…\nま、やりますけど\n好きな品物をどうぞ", -470.0, 6.5, 2);
INSERT INTO `v1_823a72cef4b6e5af278e68b9fa83e495cc87a72bb046e99b48eff7ce29f651cb` VALUES (2002, 0.0, 129602, "アネモネ", 2, "2023/12/15 15:00:00", "2024/03/22 14:59:59", 1, 10009, 3, "──いらっしゃいませ\n買い物しても、いいですよ\nキャラバンコインがあれば", -470.0, 0.0, 1);
INSERT INTO `v1_823a72cef4b6e5af278e68b9fa83e495cc87a72bb046e99b48eff7ce29f651cb` VALUES (2002, 0.0, 129602, "アネモネ", 2, "2023/12/15 15:00:00", "2024/03/22 14:59:59", 1, 10010, 3, "──もっと笑顔がほしい？\nいくらコインを積まれても\n売れない物はありますから", -470.0, 0.0, 2);
INSERT INTO `v1_823a72cef4b6e5af278e68b9fa83e495cc87a72bb046e99b48eff7ce29f651cb` VALUES (2002, 0.0, 129701, "ネフィ=ネラ", 1, "2023/12/15 15:00:00", "2024/03/22 14:59:59", 1, 10011, 3, "ようこそおいでなんし\nキャラバンコインをこちら\nで交換して進ぜんしょう", -470.0, 0.0, 1);
INSERT INTO `v1_823a72cef4b6e5af278e68b9fa83e495cc87a72bb046e99b48eff7ce29f651cb` VALUES (2002, 0.0, 129701, "ネフィ=ネラ", 2, "2023/12/15 15:00:00", "2024/03/22 14:59:59", 1, 10012, 3, "ところで、お前さまは\nいくらで贖えるのか喃？\n──フフ、冗談でありんす", -470.0, 6.2, 2);
INSERT INTO `v1_823a72cef4b6e5af278e68b9fa83e495cc87a72bb046e99b48eff7ce29f651cb` VALUES (2002, 0.0, 130301, "カノン", 3, "2024/03/15 15:00:00", "2024/06/22 14:59:59", 5, 10013, 4, "い、いらっしゃいませっ！\n…くっ…このあたくし様が\n店番なんて…屈辱ですわっ", -470.0, 3.1, 1);
INSERT INTO `v1_823a72cef4b6e5af278e68b9fa83e495cc87a72bb046e99b48eff7ce29f651cb` VALUES (2002, 0.0, 130301, "カノン", 3, "2024/03/15 15:00:00", "2024/06/22 14:59:59", 2, 10014, 4, "あら、あたくしをご所望？\nお生憎様、そんな小銭では\n…買えちゃうんですの！？", -470.0, 6.15, 2);
INSERT INTO `v1_823a72cef4b6e5af278e68b9fa83e495cc87a72bb046e99b48eff7ce29f651cb` VALUES (2002, 0.0, 130401, "ナーナ", 2, "2024/03/15 15:00:00", "2024/06/22 14:59:59", 2, 10015, 4, "いらっしゃいませ～♪\nきゃらばんこいん？を\n交換できるんだってー", -470.0, 0.0, 1);
INSERT INTO `v1_823a72cef4b6e5af278e68b9fa83e495cc87a72bb046e99b48eff7ce29f651cb` VALUES (2002, 0.0, 130401, "ナーナ", 2, "2024/03/15 15:00:00", "2024/06/22 14:59:59", 1, 10016, 4, "甘いのくれたら、\nお礼にナーナの拾った\n松ぼっくりあげちゃうよ！", -470.0, 3.35, 2);
INSERT INTO `v1_823a72cef4b6e5af278e68b9fa83e495cc87a72bb046e99b48eff7ce29f651cb` VALUES (2002, 0.0, 130502, "ホウオウ", 1, "2024/06/15 15:00:00", "2024/09/22 14:59:59", 1, 10017, 5, "ショップへようこそ\nこの鳳凰が、皆さんに\n祝福を差し上げましょう", -470.0, 0.0, 1);
INSERT INTO `v1_823a72cef4b6e5af278e68b9fa83e495cc87a72bb046e99b48eff7ce29f651cb` VALUES (2002, 0.0, 130502, "ホウオウ", 2, "2024/06/15 15:00:00", "2024/09/22 14:59:59", 1, 10018, 5, "ほーちゃんと呼ぶ権利は\n売っていませんよ？\n騎士さんへの、特別です！", -470.0, 3.18, 2);
INSERT INTO `v1_823a72cef4b6e5af278e68b9fa83e495cc87a72bb046e99b48eff7ce29f651cb` VALUES (2002, 0.0, 130503, "ホウオウ", 4, "2024/06/15 15:00:00", "2024/09/22 14:59:59", 4, 10019, 5, "うﾞぇぇえんっ！まﾞだごの\n格好になっぢゃいまじだ！\n寄付をお願いじまず～っ！", -470.0, 0.0, 3);
INSERT INTO `v1_823a72cef4b6e5af278e68b9fa83e495cc87a72bb046e99b48eff7ce29f651cb` VALUES (2002, 0.0, 123301, "ネア", 1, "2024/06/15 15:00:00", "2024/09/22 14:59:59", 2, 10020, 5, "おっすー♪\nなんでも交換してけー\nカリザきゅん以外で", -470.0, 4.9, 1);
INSERT INTO `v1_823a72cef4b6e5af278e68b9fa83e495cc87a72bb046e99b48eff7ce29f651cb` VALUES (2002, 0.0, 123301, "ネア", 1, "2024/06/15 15:00:00", "2024/09/22 14:59:59", 2, 10021, 5, "ところで、騎士きゅんは\nおいくら万ルピ？\nジョーダンぬ・き・で♡", -470.0, 4.8, 2);
